INSERT INTO config.i18n_core (fq_field, identity_value, translation, string) VALUES ('coust.description', 'opac.org_unit_hiding.depth', 'cs-CZ', 'Tím to budou skryty některé organizační jednotky v OPACu pokud fyzická lokace (parametr url "physical_loc) pro OPAC zdědí toto nastavení. Toto nastavení specifikuje hloubku, která spolu s fyzickou lokací OPACu určuje, které části organizační hierarchie mají být viditelné v OPACu. Například instalace Evergreenu bude mít  třístupňovou hierarchii (Konsocium/Systém/Knihovna), kde systém má hloubku 1 a knihovna má hloubku 2. Pokud  zde  v takovéto instalaci bude nastavení  obsahovat hloubku 1, pak každá knihovna v systému, ke které daná fyzická lokace patří, bude viditelná, a všechno ostatní bude skryto. Hloubka 0 způsobí, že každá organizační jednotka bude viditelná. OPAC ve služebním klientovi je  toto nastavení ignororváno.');
